'use strict';
import { registerLanguage } from '../_.contribution.js';
registerLanguage({
    id: 'ini',
    extensions: ['.ini', '.properties', '.gitconfig'],
    filenames: ['config', '.gitattributes', '.gitconfig', '.editorconfig'],
    aliases: ['Ini', 'ini'],
    loader: function () { return import('./ini.js'); }
});
